    const getStory = () => {
        fetch('http://localhost:4000/stories')
        .then(res => res.json())
        // .then(data => {
        //     setStory(data[1].body);
        //     console.log(data.length);
        // })
        .then(data => {
            let array = data.map(ob => <p key={ob.id}>{ob.body}</p>)
            setStory(array);
        })

    }
  return (
    <div>
        <button onClick={getStory}>Get story</button>
        <p>{story}</p>
    </div>
  )
}

export default FetchDataa;
